('paint01003', 'artist001', 'Glider design by Da ', 'Leonardo also extended his studies into engineering, science and other subjects. There seemed to be no end to his interests. He made copious notes in his complex mirror handwriting, much of which wasn’t deciphered in his lifetime. He also drew complex models of machines; in particular, he was fascinated by flight.', , 4000);
