('paint03002', 'artist003', 'Brutus', 'Brutus is a marble bust of Brutus sculpted by Michelangelo around 1539–1540. It is now in the Bargello museum in Florence. The sculpture gives Brutus an heroic aspect in keeping with political sentiment against tyranny at the time of its creation.', , 15000);
INSERT INTO `painting` (`painting_id`, `artist_id`, `painting_name`, `painting_info`, `painting_img`, `painting_price`) VALUES
